 ------</p><p>From: &quot;Sithumi Amarasinghe&quot; &lt;<a href=\"mailto:hr-mgr@insharptechnologies.com\">hr-mgr@insharptechnologies.com</a>&gt;</p><p>To: &quot;Chanaka Fernando&quot; &lt;<a href=\"mailto:chanakaf@insharptechnologies.com\">chanakaf@insharptechnologies.com</a>&gt;</p><p>Sent: 12/24/2021 1:08:39 PM</p><p>Subject: 27th and 28th off</p><p>&nbsp;</p><p>Hi,</p><p>&nbsp;</p><p>Noted and please share his approved mail with me for recording propose.</p><p>&nbsp;</p><p>&nbsp;</p><p>Best Regards,</p><p>Sithumi Amarasinghe</p><p>Assistant Manager People &amp; Culture</p><p><!--[if gte vml 1]><v:shape id=\"_x0000_i1025\" type=\"#_x0000_t75\" style=\'width:178.5pt;\r\n height:49.5pt;visibility:visible\'>\r\n <v:imagedata src=\"cid:image001.png@01d7f8c7.5a67ee60\"/>\r\n</v:shape><![endif]--></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>Insharp Technologies (Pvt) Ltd</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A:&nbsp; No. 129/1/1, Highlevel Road, Maharagama,<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Colombo, Sri Lanka.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; M:&nbsp; +94 (0) 711339336</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E : &nbsp;<a href=\"mailto:hr@insharptechnologies.com\">hr@insharptechnologies.com</a></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; W:&nbsp; <a href=\"http://www.insharptechnologies.com/\">www.insharptechnologies.com</a></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>From: </strong><a href=\"mailto:chanakaf@insharptechnologies.com\">Chanaka Fernando</a><br /><strong>Sent: </strong>Friday, December 24, 2021 10:44 AM<br /><strong>To: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">Sithumi Amarasinghe</a>; <a href=\"mailto:rangana@insharptechnologies.com\">Rangana Samarasinghe</a><br /><strong>Subject: </strong>27th and 28th off</p><p>&nbsp;</p><p>Hi Sithu,</p><p>&nbsp;</p><p>I will be taking the 27th and 28th off this month. I spoke to Prasanna (SRA IT) about this and he is okay with it.</p><p>&nbsp;</p><p>Regards,</p><p>Chanaka</p><p>&nbsp;</p><p>&nbsp;</p>',21,2,'2021-12-28','2021-12-27 06:10:02','2021-12-27 06:10:02',1.00),(297,'','<p>Dear Sithumi</p><p>&nbsp;</p><p>I would like to inform that I&rsquo;m planning to take a leave from 28.12.2021 due to &nbsp;My&nbsp; Dental treatments.</p><p>&nbsp;</p><p>I appreciate your consideration and approval to my request.</p><p>&nbsp;</p><p>Thank You!</p>',35,2,'2021-12-28','2021-12-27 10:19:18','2021-12-27 10:19:18',1.00),(298,'','<p><strong>From: </strong><a href=\"mailto:supunr@insharptechnologies.com\">Supun Rajapaksha</a><br /><strong>Sent: </strong>Wednesday, December 29, 2021 11:11 AM<br /><strong>To: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">&#39;Wathsala Dissanayake&#39;</a><br /><strong>Subject: </strong>FW: Leave on 30th and 31st</p><p>&nbsp;</p><p>Accepted.</p><p>&nbsp;</p><p><strong>From:</strong> Devin Yasas [mailto:deviny@insharptechnologies.com]<br /><strong>Sent:</strong> Wednesday, December 29, 2021 10:36 AM<br /><strong>To:</strong> yashanw@insharptechnologies.com<br /><strong>Cc:</strong> Supun Rajapaksha; Sithumi Amarasinghe<br /><strong>Subject:</strong> Leave on 30th and 31st</p><p>&nbsp;</p><p>I am writing this email to request you to grant me a leave of absence from 30th to 31st of December. As this is the vacation time, my family and I are taking a vacation.&nbsp;I have ensured that all my responsibilities. And I already informed the client about this leave.&nbsp;</p><p>&nbsp;</p><p>In case of any pressing issue, I will be available at +94712557288 anytime .</p><p>I thank you in advance for your approval of my leave application.</p><p>Warm Regards,&nbsp;</p><p>Devin</p><p>----------------------------------------------------------------------------------</p><p>We informed client. The mail was sent by Thikshan.&nbsp;</p><p>--</p><p>Best Regards,&nbsp;</p><p>Devin</p><p><br />Begin forwarded message:</p><p><strong>From:</strong> Devin Yasas