e both projects.</p><p>&nbsp;</p><p>Till then I can start working on todo list.&nbsp;</p><p>(Pepperjam and Impact radius)&nbsp;</p><p>If you can explain/ give me information on what we have to do on those it would be helpful for me to start on those two from tomorrow.&nbsp;</p><p>&nbsp;</p><p>--</p><p>Best Regards,&nbsp;</p><p>Devin</p>',3,1,'2021-12-30','2021-12-29 07:32:09','2021-12-29 07:35:29',1.00),(299,'','<p><strong>From: </strong><a href=\"mailto:supunr@insharptechnologies.com\">Supun Rajapaksha</a><br /><strong>Sent: </strong>Wednesday, December 29, 2021 11:11 AM<br /><strong>To: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">&#39;Wathsala Dissanayake&#39;</a><br /><strong>Subject: </strong>FW: Leave on 30th and 31st</p><p>&nbsp;</p><p>Accepted.</p><p>&nbsp;</p><p><strong>From:</strong> Devin Yasas [mailto:deviny@insharptechnologies.com]<br /><strong>Sent:</strong> Wednesday, December 29, 2021 10:36 AM<br /><strong>To:</strong> yashanw@insharptechnologies.com<br /><strong>Cc:</strong> Supun Rajapaksha; Sithumi Amarasinghe<br /><strong>Subject:</strong> Leave on 30th and 31st</p><p>&nbsp;</p><p>I am writing this email to request you to grant me a leave of absence from 30th to 31st of December. As this is the vacation time, my family and I are taking a vacation.&nbsp;I have ensured that all my responsibilities. And I already informed the client about this leave.&nbsp;</p><p>&nbsp;</p><p>In case of any pressing issue, I will be available at +94712557288 anytime .</p><p>I thank you in advance for your approval of my leave application.</p><p>Warm Regards,&nbsp;</p><p>Devin</p><p>-------------------------------------------------------------------------------------</p><p>We informed client. The mail was sent by Thikshan.&nbsp;</p><p>--</p><p>Best Regards,&nbsp;</p><p>Devin</p><p><br />Begin forwarded message:</p><p><strong>From:</strong> Devin Yasas &lt;deviny@insharptechnologies.com&gt;<br /><strong>Date:</strong> 28 December 2021 at 5:38:28 PM GMT+5: