INSERT INTO `leaves` VALUES (380,'','<p><strong>From: </strong><a href=\"mailto:supunr@insharptechnologies.com\">Supun Rajapaksha</a><br /><strong>Sent: </strong>Wednesday, February 23, 2022 8:52 AM<br /><strong>To: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">&#39;Sithumi Amarasinghe&#39;</a><br /><strong>Subject: </strong>FW: Request a leave</p><p>&nbsp;</p><p>Accepted.</p><p>&nbsp;</p><p>-----Original Message-----</p><p>From: Ravindra Wimalasiri [mailto:ravindraw@insharptechnologies.com]</p><p>Sent: Tuesday, February 22, 2022 5:11 PM</p><p>To: Yashan Waruna; &#39;Supun Rajapaksha&#39;; hr-mgr@insharptechnologies.com</p><p>Subject: Request a leave</p><p>&nbsp;</p><p>Dear Yashan/Supun,</p><p>&nbsp;</p><p>&nbsp;&nbsp; I would like to request a leave tomorrow (23rd February).</p><p>&nbsp;</p><p>&nbsp;</p><p>Thank you.</p><p>&nbsp;</p><p>Ravindra.</p>',11,2,'2022-02-23','2022-02-23 03:44:07','2022-02-23 03:44:07',1.00),(381,'','<p><strong>From: </strong><a href=\"mailto:thikshan@gmail.com\">Thikshan Arulampalam</a><br /><strong>Sent: </strong>Monday, February 28, 2022, 9:08 AM<br /><strong>To: </strong><a href=\"mailto:yashanw@insharptechnologies.com\">Yashan Waruna</a><br /><strong>Cc: </strong><a href=\"mailto:tony.bishop@vbhpartners.com\">Tony Bishop</a>; <a href=\"mailto:brian.beard@vbhpartners.com\">Brian Beard</a>; <a href=\"mailto:rangana@insharptechnologies.com\">Rangana Samarasinghe</a>; <a href=\"mailto:sauharda.dawadi@vbhpartners.com\">Sauharda Dawadi</a>; <a href=\"mailto:induwarae@insharptechnologies.com\">induwarae@insharptechnologies.com</a>; <a href=\"mailto:hr-mgr@insharptechnologies.com\">Wathsala Dissanayake</a><br /><strong>Subject: </strong>Re: Leave Notice</p><p>&nbsp;</p><p>Thank you for letting us know. Glad you are in better health. Trust your family is well too.</p><p>&nbsp;</p><p>On Mon, Feb 28, 2022 at 9:01 AM Yashan Waruna &lt;<a href=\"mailto:yashanw@insharptechnologies.com\">yashanw@insharptechnologies.com</a>&gt; wrote:</p><p>Hi Team,</p><p>&nbsp;</p><p>I&rsquo;m back to work from today onwards. I was on leave last Friday (02/25/2022) also. Everything getting back to normal now. Thank you very much for your support.</p><p>&nbsp;</p><p>--</p><p><strong>Best Regards,<br /><br />Yashan Waruna<br />Head of Software Engineering</strong><br /><br /><!--[if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @0 0 1\"/>\r\n  <v:f eqn=\"prod @6 1 2\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n  <v:f eqn=\"sum @8 21600 0\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @10 21600 0\"/>\r\n </v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\r\n</v:shapetype><v:shape id=\"_x0000_i1026\" type=\"#_x0000_t75\" style=\'width:105.75pt;\r\n height:29.25pt;visibility:visible\'>\r\n <v:imagedata src=\"cid:17f3e683058e8c45fc1\"/>\r\n</v:shape><![endif]--></p><p>N. 129/1/1, Highlevel Road, Maharagama,<br />Colombo, Sri Lanka.<br />E mail : <a target=\"_blank\" href=\"mailto:info@insharptechnologies.com\">info@insharptechnologies.com</a><br />Tel : +94 (0) 11 2839594 / +94 (0) 712669593</p><p>&nbsp;</p><p><strong>From: </strong><a target=\"_blank\" href=\"mailto:yashanw@insharptechnologies.com\">Yashan Waruna</a><br /><strong>Sent: </strong>Tuesday, February 22, 2022 7:35 PM<br /><strong>To: </strong><a target=\"_blank\" href=\"mailto:tony.bishop@vbhpartners.com\">Tony Bishop</a>; <a target=\"_blank\" href=\"mailto:brian.beard@vbhpartners.com\">Brian Beard</a><br /><strong>Cc: </strong><a target=\"_blank\" href=\"mailto:rangana@insharptechnologies.com\">Rangana Samarasinghe</a>; <a target=\"_blank\" href=\"mailto:thikshan@gmail.com\">Thikshan Arulampalam</a>; <a target=\"_blank\" href=\"mailto:sauharda.dawadi@vbhpartners.com\">Sauharda Dawadi</a>; <a target=\"_blank\" href=\"mailto:induwarae@insharptechnologies.com\">induwarae@insharptechnologies.com</a>; <a target=\"_blank\" href=\"mailto:hr-mgr@insharptechnologies.com\">Wathsala Dissanayake</a><br /><strong>Subject: </strong>Leave Notice</p><p>&nbsp;</p><p>Hi Team,</p><p>&nbsp;</p><p>I&#39;ll be on sick leave on 22/23,24 February 2022. All the family members are tested positive from Covid. My wife and daughter admit to the hospital and I&#39;m at home. Hope everything settles soon.</p><p>&nbsp;</p><p>--</p><p><strong>Best Regards,<br /><br />Yashan Waruna<br />Head of Software Engineering</strong><br /><br /><!--[if gte vml 1]><v:shape\r\n id=\"_x0000_i1025\" type=\"#_x0000_t75\" style=\'width:105.75pt;height:29.25pt;\r\n visibility:visible\'>\r\n <v:imagedata src=\"cid:17f3e683058e8c45fc1\"/>\r\n</v:shape><![endif]--></p><p>N. 129/1/1, Highlevel Road, Maharagama,<br />Colombo, Sri Lanka.<br />E mail : <a target=\"_blank\" href=\"mailto:info@insharptechnologies.com\">info@insharptechnologies.com</a><br />Tel : +94 (0) 11 2839594 / +94 (0) 712669593</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>--</p><p>&nbsp;</p><p>Thikshan Arulampalam</p><p>Mobile:617 642 9426</p><p><a target=\"_blank\" href=\"https://www.lipa.fyi/\">LIPA </a>Your Technology Partner</p><p><a target=\"_blank\" href=\"https://www.linkedin.com/in/thikshan-arulampalam-101172/\">Linkedin</a></p><p>&nbsp;</p>',22,3,'2022-02-25','2022-02-25 04:50:19','2022-02-28 12:39:50',1.00),(382,'','<p><strong>From: </strong><a href=\"mailto:supunr@insharptechnologies.com\">Supun Rajapaksha</a><br /><strong>Sent: </strong>Friday, February 25, 2022 9:36 AM<br /><strong>To: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">&#39;Sithumi Amarasinghe&#39;</a><br /><strong>Subject: </strong>FW: Leave on Friday 25th</p><p>&nbsp;</p><p>Accepted.</p><p>&nbsp;</p><p><strong>From:</strong> Devin Yasas [mailto:deviny@insharptechnologies.com]<br /><strong>Sent:</strong> Friday, February 25, 2022 1:55 AM<br /><strong>To:</strong> yashanw@insharptechnologies.com<br /><strong>Cc:</strong> Supun Rajapaksha; Sithumi Amarasinghe<br /><strong>Subject:</strong> Leave on Friday 25th</p><p>&nbsp;</p><p>I&rsquo;m hereby to request a leave on Friday as my Mother started showing symptoms like fever since Thursday. It&rsquo;s almost past midnight and we decided to take her for medical treatment today(Friday). So I have to take care of it. I&lsquo;ve finished all my tasks for the date and also recently I submitted test cases of challenges and new challenges on Hacker rank. All handed over to Dilan as of this time. I hope you would consider my request.&nbsp;</p><p>--</p><p>Sincerely,</p><p>Devin</p><p>&nbsp;( ASE )</p>',3,1,'2022-02-25','2022-02-25 04:50:58','2022-02-25 04:55:56',1.00),(383,'','<p><strong>From: </strong><a href=\"mailto:supunr@insharptechnologies.com\">Supun Rajapaksha</a><br /><strong>Sent: </strong>Monday, February 28, 2022 10:58 AM<br /><strong>To: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">&#39;Sithumi Amarasinghe&#39;</a><br /><strong>Subject: </strong>FW: Informing a sick leave</p><p>&nbsp;</p><p>Accepted.</p><p>&nbsp;</p><p>-----Original Message-----</p><p>From: BimaliA [mailto:bimalia@insharptechnologies.com]</p><p>Sent: Monday, February 28, 2022 5:05 AM</p><p>To: hr-mgr@insharptechnologies.com</p><p>Cc: supunr</p><p>Subject: Informing a sick leave</p><p>&nbsp;</p><p>&nbsp;</p><p>Hi,</p><p>This is to inform I will be having a leave as I feel under the weather today.</p><p>&nbsp;</p><p>Thank You</p><p>Bimali Abegunarathna</p>',27,2,'2022-02-28','2022-02-28 05:47:57','2022-02-28 05:47:57',1.00),(384,'','<p>Hello Tharushi,<br /><br />I am happy to approve your request for half-day leave for the 1st of March. I certainly understand your requirement for the eye channel. Please meet sithumi if you have any paperwork concerns .</p><p><br />Best Regards,<br />Tharaka Mendis,</p><p>Digital Marketing Manager,</p><p>Bizmo Technologies.</p><p><!-- [if mso]>\r\n				</td>\r\n				<![endif]--><!-- [if mso]>\r\n				</tr>\r\n				</table>\r\n				<![endif]--></p><p>..........................................................</p><p><strong>From: </strong><a href=\"mailto:tharuship@bizmo.info\">Tharushi Perera</a><br /><strong>Sent: </strong>Monday, February 28, 2022 10:12 AM<br /><strong>To: </strong><a href=\"mailto:lakshithaf@bizmo.info\">Lakshitha Fernando</a>; <a href=\"mailto:tharakam@bizmo.info\">tharakam@bizmo.info</a>; <a href=\"mailto:hr-mgr@insharptechnologies.com\">hr-mgr@insharptechnologies.com</a>; <a href=\"mailto:rangana@insharptechnologies.com\">Rangana Samarasinghe</a><br /><strong>Subject: </strong>Request for half-day leave.</p><p>&nbsp;</p><p>Dear all,</p><p>&nbsp;</p><p>I would like to inform you that I&rsquo;m planning to take a half-day leave (evening half) from 01.03.2022 due to &nbsp;Chanel an eye specialist.</p><p>&nbsp;</p><p>I appreciate your consideration and approval of my request.</p><p>&nbsp;</p><p>Thank You!</p>',35,2,'2022-03-01','2022-02-28 12:36:11','2022-02-28 13:21:55',0.50),(385,'','<p><strong>From: </strong><a href=\"mailto:laith.suwieti@gmail.com\">laith suwieti</a><br /><strong>Sent: </strong>Friday, February 25, 2022 4:13 PM<br /><strong>To: </strong><a href=\"mailto:sachithb@insharptechnologies.com\">sachithb@insharptechnologies.com</a><br /><strong>Cc: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">Wathsala Dissanayake</a><br /><strong>Subject: </strong>Re: Inform leave 2022-02-25</p><p>&nbsp;</p><p>Noted.</p><p>&nbsp;</p><p>On Fri, 25 Feb 2022 at 6:38 AM <a href=\"mailto:sachithb@insharptechnologies.com\">sachithb@insharptechnologies.com</a> &lt;<a href=\"mailto:sachithb@insharptechnologies.com\">sachithb@insharptechnologies.com</a>&gt; wrote:</p><p>Dear All,</p><p>&nbsp;</p><p>I will take off toady because of my personal reason.</p><p>&nbsp;</p><p>Thankyou</p><p>&nbsp;</p><p>--</p><p>Laith Suwieti<br />+965 658 53 063<br />+962&nbsp; 97 3030 39</p>',13,2,'2022-02-25','2022-02-28 13:04:24','2022-02-28 13:04:24',1.00),(386,'','<p><strong>From: </strong><a href=\"mailto:supunr@insharptechnologies.com\">Supun Rajapaksha</a><br /><strong>Sent: </strong>Wednesday, March 2, 2022 8:55 AM<br /><strong>To: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">&#39;Sithumi Amarasinghe&#39;</a><br /><strong>Subject: </strong>FW: Request for a one day leave on 2nd march</p><p>&nbsp;</p><p>Accepted.</p><p>&nbsp;</p><p><strong>From:</strong> Nadeesha Shihani [mailto:nadeeshas@insharptechnologies.com]<br /><strong>Sent:</strong> Monday, February 28, 2022 5:20 PM<br /><strong>To:</strong> Yashan Waruna<br /><strong>Cc:</strong> Supun Rajapaksha; Wathsala Dissanayake<br /><strong>Subject:</strong> Request for a one day leave on 2nd march</p><p>&nbsp;</p><p>&nbsp;</p><p>Dear Yashan,</p><p>&nbsp;</p><p>I am submitting this request for a leave of absence for my personal matter on 2nd of march.</p><p>&nbsp;</p><p>I&#39;m trying in my best to make myself available intermittently to answer questions via mobile or zoom.</p><p>Thank you for your consideration.</p><p>&nbsp;</p><p>Thank You.</p><p>Nadeesha Shihani.</p><p>Sent from <a href=\"https://go.microsoft.com/fwlink/?LinkId=550986\">Mail</a> for Windows</p><p>&nbsp;</p>',8,2,'2022-03-02','2022-02-28 13:38:30','2022-03-02 03:35:29',1.00),(387,'','<p>&nbsp;</p><p><strong>From: </strong><a href=\"mailto:induwarae@insharptechnologies.com\">Pasan Edirisooriya</a><br /><strong>Sent: </strong>Monday, February 28, 2022 9:12 AM<br /><strong>To: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">Sithumi Amarasinghe</a><br /><strong>Cc: </strong><a href=\"mailto:supunr@insharptechnologies.com\">Supun Rajapaksha</a><br