 /><strong>Sent:</strong> Monday, May 2, 2022 1:35 PM<br /><strong>To:</strong> Sithumi<br /><strong>Cc:</strong> supunr@insharptechnologies.com<br /><strong>Subject:</strong> Leave for Ramadan Festival</p><p>&nbsp;</p><p>Hello, Sithumi.</p><p>&nbsp;</p><p>I&#39;m requesting a leave on May 3rd for the Ramadan Festival.</p><p>&nbsp;</p><p>Thank You,</p><p>&nbsp;</p><p>Labeeb Mahir</p><p>&nbsp;</p><p>&nbsp;</p><p>Begin forwarded message:</p><p>&nbsp;</p><p><strong>From: </strong>Labeeb &lt;<a href=\"mailto:labeebm@insharptechnologies.com\">labeebm@insharptechnologies.com</a>&gt;</p><p><strong>Subject: Leave for Ramadan Festival </strong></p><p><strong>Date: </strong>April 29, 2022 at 5:59:39 PM GMT+5:30</p><p><strong>To: </strong>Sithumi &lt;<a href=\"mailto:hr-mgr@insharptechnologies.com\">hr-mgr@insharptechnologies.com</a>&gt;</p><p><strong>Cc: </strong><a href=\"mailto:supunr@insharptechnologies.com\">supunr@insharptechnologies.com</a></p><p>&nbsp;</p><p>Hello, Sithumi.</p><p>&nbsp;</p><p>I&#39;m requesting leave for the Ramadan Festival, which will take place on May 2nd or 3rd.</p><p>&nbsp;</p><p>The exact date of the event will not be known until after 6pm on May 1st, when the Grand Mosque&nbsp;of Colombo&nbsp;sees and confirms the new moon for the following Islamic month.</p><p>&nbsp;</p><p>Thank You,</p><p>&nbsp;</p><p>Labeeb Mahir</p>',44,2,'2022-05-03','2022-05-02 08:20:11','2022-05-02 08:47:16',1.00),(454,'','<p>Hi,</p><p>&nbsp;</p><p>Your leave has been approved ?.</p><p>&nbsp;</p><p>&nbsp;</p><p>Best Regards,</p><p>Sithumi Amarasinghe</p><p>Assistant Manager People &amp; Culture</p><p><!--[if mso & !supportInlineShapes & supportFields]><span\r\nstyle=\'mso-bookmark:_olk_signature\'></span><span style=\'mso-element:field-begin;\r\nmso-field-lock:yes\'></span><span style=\'mso-bookmark:_olk_signature\'><span\r\nstyle=\'mso-spacerun:yes\'> </span>SHAPE <span\r\nstyle=\'mso-spacerun:yes\'> </span>\\* MERGEFORMAT <span style=\'mso-element:field-separator\'></sp