sential matters.</p><p>&nbsp;</p><p>&nbsp;</p><p>Date</p><p>Leave</p><p>23-06-2022</p><p>leave</p><p>27-06-2022</p><p>leave</p><p>30-06-2022</p><p>leave</p><p>05-07-2022</p><p>leave</p><p>06-07-2022</p><p>leave</p><p>&nbsp;</p><p>So I hope you can understand me and accept my leave plan.</p><p>&nbsp;</p><p>Thank you.</p><p>Nadeesha Shihani</p><p>&nbsp;</p><p>Sent from <a href=\"https://go.microsoft.com/fwlink/?LinkId=550986\">Mail</a> for Windows</p><p>&nbsp;</p><p>&nbsp;</p>',8,1,'2022-06-23','2022-06-24 04:00:27','2022-06-24 04:00:27',1.00),(494,'','<p>Hello Sithumi,</p><p>&nbsp;</p><p>I am writing this to formally inform you of I got sick leave on 17th of June 2022 .</p><p>&nbsp;</p><p>Thank you.</p><p>Nadeesha Shihani.</p><p>Sent from <a href=\"https://go.microsoft.com/fwlink/?LinkId=550986\">Mail</a> for Windows</p>',8,1,'2022-06-17','2022-06-24 04:01:43','2022-06-24 04:01:43',1.00),(495,'','<p><strong>From: </strong><a href=\"mailto:sanjeewanm@insharptechnologies.com\">sanjeewanm@insharptechnologies.com</a><br /><strong>Sent: </strong>Wednesday, June 29, 2022 12:38 PM<br /><strong>To: </strong><a href=\"mailto:hr-mgr@insharptechnologies.com\">Sithumi Amarasinghe</a><br /><strong>Subject: </strong>FW: Re: Leave Request</p><p>&nbsp;</p><p>Hi,</p><p>Full day leave on <strong>30th of June 2022</strong></p><p>Thank you</p><p>&nbsp;</p><p>-----Original Message-----<br />From: &quot;Waldo Miranda&quot; &lt;waldo@itworx.com.au&gt;<br />Sent: Wednesday, June 29, 2022 12:34pm<br />To: &quot;sanjeewanm@insharptechnologies.com&quot; &lt;sanjeewanm@insharptechnologies.com&gt;<br />Subject: Re: Leave Request</p><p>All good Sanjeevan!</p><p>Waldo</p><p>Get <a href=\"https://aka.ms/o0ukef\">Outlook for iOS</a></p><p><!--[if mso & !supportInlineShapes & supportFields]><span\r\nstyle=\'mso-element:field-begin;mso-field-lock:yes\'></span><span\r\nstyle=\'mso-spacerun:yes\'> </span>SHAPE <span\r\nstyle=\'mso-spacerun:yes\'> </span>\\* MERGEFORMAT <span style=\'mso-element:field-se