e of the resources that the client requests. Enter a list of APIs scope names separated by spaces if applicable.)</li><li>agency_name (WC)</li><li>environment (PROD, SUPP, DEV etc.)</li></ul><p>&nbsp;</p><p>You should then be able to successfully get a Token!</p><p>&nbsp;</p><p>Please let me know if you have any issues with this. If so I&#39;ll relay it back to Engineering and do further testing for you!</p>',23,11,4,1.00,NULL,'2021-07-30','2021-08-02 01:54:25','2021-08-02 01:54:25','2021-07-30',1,NULL,NULL,0),(2980,'Meeting AWS',NULL,15,7,4,0.50,NULL,'2021-07-30','2021-08-02 04:03:27','2021-08-02 04:03:27','2021-08-02',1,NULL,NULL,0),(2981,'Super admin analytics',NULL,58,7,4,2.50,NULL,'2021-07-30','2021-08-02 04:05:29','2021-08-02 04:05:29','2021-08-02',0,NULL,NULL,0),(2982,'Sia server configurations- Maintenance',NULL,15,7,4,0.50,NULL,'2021-07-30','2021-08-02 04:08:01','2021-08-02 04:08:01','2021-08-02',0,NULL,NULL,0),(2983,'Job campaigns updates',NULL,58,7,4,2.50,NULL,'2021-07-30','2021-08-02 04:09:48','2021-08-02 04:09:48','2021-08-02',0,NULL,NULL,0),(2984,'User login UI development',NULL,58,2,4,5.00,NULL,NULL,'2021-08-02 09:56:02','2021-08-02 09:56:02','2021-07-30',0,NULL,NULL,0),(2985,'User register UI development',NULL,58,2,4,6.00,NULL,NULL,'2021-08-02 09:57:29','2021-08-10 16:55:38','2021-08-10',0,NULL,NULL,0),(2986,'MMS make rent invoice and credit notes SAP upload again',NULL,12,11,4,2.00,NULL,'2021-08-02','2021-08-02 11:49:15','2021-08-02 11:49:15','2021-08-02',0,NULL,NULL,0),(2987,'Morning',NULL,39,14,4,1.25,NULL,NULL,'2021-08-02 12:33:46','2021-08-02 12:33:46','2021-08-02',1,NULL,NULL,0),(2988,'Stripe connect review',NULL,46,14,4,0.50,NULL,NULL,'2021-08-02 12:34:24','2021-08-02 12:34:24','2021-08-02',0,NULL,NULL,0),(2989,'Weekly meeting',NULL,15,14,4,1.00,NULL,NULL,'2021-08-02 12:35:01','2021-08-02 12:35:01','2021-08-02',1,NULL,NULL,0),(2990,'Weekly meeting',NULL,46,14,4,1.00,NULL,NULL,'2021-08-02 12:35:29','2021-08-02 12:35:29','2021-08-02',1,NULL,NULL