at this point</p><p>Check the same scenario for Join, view and remove options</p>',1,51,4,0.00,NULL,NULL,'2022-05-20 07:37:32','2022-06-01 12:30:40','2022-06-01',0,NULL,113,0),(8578,'Allow tutor to edit the quiz questions and answers that they add before the class by uploading an excel sheet','<p>They should be able to :<br />Edit the question<br />Edit the answer options<br />Remove answer options<br />Add new answers<br />Change the correct answer<br /><br />Note: All these changes are possible only before the quiz is published</p><p>&nbsp;</p>',1,50,4,0.00,NULL,NULL,'2022-05-20 07:46:36','2022-06-01 11:55:36','2022-06-01',0,NULL,113,0),(8579,'UI when the quiz / poll have more than 4 answer options',NULL,1,44,4,0.00,NULL,NULL,'2022-05-20 07:47:55','2022-05-29 17:53:46','2022-05-29',0,NULL,113,0),(8580,'Quiz/ poll with blank answer options','<p><strong>Issue- please fill out this field appears but at the same time the quiz published to th student with a empty answer slot</strong></p><p>Tutor is able to save a quiz/poll with an empty answer option. This quiz can then be published. Which means the student will see an empty field as an answer options.</p><p>&nbsp;</p><p>To do : Allow tutor to save the quiz but validate when it is being published. All questions and answer options need to be filled. User can remove an answer option and proceed if they added an extra answer option by mistake.<br /><br />Note: When trying to submit the answer selecting a blank option there was an error</p>',1,51,4,0.00,NULL,NULL,'2022-05-20 07:59:15','2022-06-09 05:37:00','2022-06-09',0,NULL,113,0),(8581,'was not able to update recruiter profile detail',NULL,58,42,4,0.00,NULL,NULL,'2022-05-20 09:47:04','2022-05-23 06:44:54','2022-05-20',0,NULL,NULL,0),(8582,'Allow tutor to edit the poll questions and answers that they add before the class by uploading an excel sheet during the class','<p>During the class the tutor&nbsp;should be able to :<br />Edit the question<br />Edit the answer options<br />Remove answer options<br />Add new answers<br /><br /><br />Note: All these changes are possible only before the poll&nbsp;is published</p>',1,43,4,0.00,NULL,NULL,'2022-05-20 09:53:57','2022-06-01 10:16:46','2022-06-01',0,NULL,113,0),(8583,'Tuti Error during class','<p>Access to XMLHttpRequest at &#39;https://meet4.tuti.world/socket.io/?EIO=3&amp;transport=polling&amp;t=O3WyuMc&#39; from origin &#39;https://22001.tuti.world&#39; has been blocked by CORS policy: No &#39;Access-Control-Allow-Origin&#39; header is present on the requested resource.<br />app.js:40201 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br /><br />GET https://meet4.tuti.world/socket.io/?EIO=3&amp;transport=polling&amp;t=O3WyuMc net::ERR_FAILED 200<br /><br />This error keeps appearing even if the user doesnt do anything.&nbsp;</p>',1,51,1,0.00,NULL,NULL,'2022-05-20 10:13:12','2022-07-05 03:16:45','2022-07-05',0,NULL,113,0),(8584,'research and create paala meme',NULL,6,47,4,2.00,NULL,NULL,'2022-05-20 10:33:31','2022-05-20 12:26:25','2022-05-20',0,NULL,NULL,0),(8585,'UI : Student stick note : Add note button position','<p>The button looks like its placed randomly</p>',1,44,4,0.00,NULL,NULL,'2022-05-20 10:40:10','2022-05-29 17:53:38','2022-05-29',0,NULL,113,0),(8586,'Meeting HR+Bizmo',NULL,6,35,4,0.75,NULL,NULL,'2022-05-20 11:18:37','2022-05-20 11:25:01','2022-05-20',1,NULL,NULL,0),(8587,'Uconnect 24th Tuesday Post ( Search,Design,Caption,Write )',NULL,6,35,4,3.00,NULL,NULL,'2022-05-20 11:19:52','2022-05-26 04:46:44','2022-05-26',0,NULL,NULL,0),(8588,'TBH 20th Post Finish  and uploaded( Desgin)',NULL,6,35,4,2.00,NULL,NULL,'2022-05-20 11:21:03','2022-05-20 11:24:19','2022-05-20',0,NULL,NULL,0),(8589,'Kamuda(Chocoholic) IG,FB Post Create',NULL,6,35,4,1.00,NULL,NULL,'2022-05-20 11:23:54','2022-05-20 11:24:48','2022-05-20',0,NULL,NULL,0),(8590,'Think through the quiz experience','<p>Problems :<br /><br />1. After a quiz is published, the students that answer are ranked and displayed to the tutor. However a ranking of a student&nbsp;depends on the marks of the other students and therefore may change after everyone submits their answer.</p><p>Eg: 10 students are in the class, 5 students&nbsp;answer. The other students are yet to submit the answers. Tutor will see Student 1 as the highest ranked with 80 marks. However once Student 6 submits their answer they may score 90% and come on top.&nbsp;<br /><br />Also, The tutor might ask the students to answer and want to know who is yet to answer. Therefore it might be better to show the tutor the list of students that are yet to answer.<br /><br />2. The marks are not always accurate&nbsp;<br /><br />Eg : The tutor may create a quiz with 5 questions&nbsp;and then publish it. All the students will answer and lets say Student A gets 50% and Student B gets 0. The tutor can now publish a second set of questions. At this point if Student B answers correctly and submits it before Student A the results will appear&nbsp;as Student A 50% and Student B 100%. But Student A has not answered as yet.<br /><br />3. To add a quiz questioon the tutor has to first click through all the questions.&nbsp;<br /><br />Eg: If I publish a quiz with 10 questions. If I want to add a 11th question I need to start from the first one and click &#39;next&#39; through all 10 questions to add question 11.&nbsp;<br />&nbsp;</p>',1,44,2,0.00,NULL,NULL,'2022-05-20 11:37:13','2022-08-12 03:36:36','2022-08-12',0,NULL,113,0),(8591,'Show the student the latest unanswered poll question','<p><strong>Issue - previous questions were shown with a white background</strong></p><p><strong>Even though I have published multiple polls I only can answer the unanswered first poll. once it answered I have to go back to polls to answer the rest. (there is no next button)</strong></p><p><strong>And previously answered polls are not shown there (only the polls which I need to answer are shown)</strong></p><p>&nbsp;</p><p>After submitting a poll once, if the tutor adds questions to it and submits it again,&nbsp;<br /><br />If the student has not submitted&nbsp;the answers for the first set of questions, they should see the first question of the first set.&nbsp;<br /><br />If the student has submitted the answers for&nbsp;the first set of questions then the student should see the first question of the new set of questions<br /><br />Note : The quiz works the way I have explained it above. I want the poll to work the same way.</p><p>&nbsp;</p><p>&nbsp;</p>',1,51,4,0.00,NULL,NULL,'2022-05-20 11:42:13','2022-06-02 11:30:26','2022-06-02',0,NULL,113,0),(8592,'Think through the poll experience','<p>Problems&nbsp;<br /><br />1. The poll result appears as a graph. Therefore looking at it a tutor might think the majority is saying something but it is possible that most of the students have not answered.&nbsp;<br /><br />Eg: 5 students in the class but only 1 student submits option A. The tutor will see a pie chart fully covered for option A. Therefore it looks like the majority is thinking option A. However this is not accurate as 4 students have not answered. (I have attached an image of a possible solution)<br /><br />2. Currently the tutor can only see the number of students that answered but not who answered what. Tutor may also need the option to see which students picked a specific&nbsp;option.<br />3. If no students have answered the tutor only sees the answer options.</p>',1,44,2,0.00,NULL,NULL,'2022-05-20 11:56:38','2022-08-12 03:36:36','2022-08-12',0,NULL,113,0),(8593,'Improve the UI of the file upload section in the class',NULL,1,44,2,0.00,NULL,NULL,'2022-05-20 12:06:47','2022-08-12 03:36:36','2022-08-12',0,NULL,113,0),(8594,'Hide the jitsi breakout room option',NULL,1,8,4,0.00,NULL,NULL,'2022-05-20 12:09:23','2022-06-08 07:52:02','2022-06-06',0,NULL,113,0),(8595,'create may 26th content',NULL,6,47,4,5.00,NULL,NULL,'2022-05-23 04:39:53','2022-05-23 09:47:48','2022-05-23',0,NULL,NULL,0),(8596,'create meme for paala',NULL,6,47,4,2.00,NULL,NUL