ul></li></ul><p>&nbsp;</p><ul><li><p><strong>Intermediate or experienced (senior staff)</strong></p><ul><li><p><strong>The intermediate job level requires experience and often specialized training. The intermediate job level has no supervisory duties but still requires knowledge and a history of work experience within the industry. At this level, the employee requires less supervision and may receive more opportunities to work independently.</strong></p></li></ul></li></ul><p>&nbsp;</p><ul><li><p><strong>Entry-level</strong></p></li></ul><p>&nbsp;</p><ul><li><p><strong>Most people who enter the workforce start their careers in entry-level positions. Recent graduates or those starting in a new industry begin in an <a href=\"https://www.indeed.com/career-advice/finding-a-job/what-is-an-entry-level-job\">entry-level position</a> to learn how to perform the duties needed in their chosen field. Entry-level jobs involve routine daily tasks that mid-level managers supervise. At this level, employees gain the skills and experience to be successful in their field.</strong></p></li></ul>',58,42,1,0.00,NULL,NULL,'2022-07-25 08:16:44','2022-08-03 05:26:51','2022-08-03',0,NULL,116,0),(9176,'New server set up - Staging',NULL,58,33,4,0.00,NULL,NULL,'2022-07-26 03:53:16','2022-08-12 03:46:37','2022-08-12',0,NULL,NULL,0),(9177,'New server set up - Production',NULL,58,33,1,0.00,NULL,NULL,'2022-07-26 03:53:34','2022-08-15 07:06:35','2022-08-15',0,NULL,NULL,0),(9179,'Review user journeys related to Sprint 2',NULL,80,31,4,0.00,NULL,NULL,'2022-07-27 03:56:10','2022-08-10 03:33:16','2022-08-10',0,NULL,139,0),(9180,'PDFtron sample project','<p>Modelling the requirements and implement a sample pdftron app using such sample activities to do with pdftron while learning the pdftron.</p>',80,55,3,0.00,NULL,'2022-08-05','2022-07-27 04:54:27','2022-08-12 03:37:51','2022-08-12',0,NULL,139,0),(9181,'Alternew Messages UI',NULL,89,44,4,0.00,NULL,NULL,'2022-07-27 05:52:36','2022-07-29 04:01:04','2022-