 New Note</p><p>Sales Orders List View with searching and filtering</p><p>Create new sales order, bring up customer past ordered items, line comments, item history and copy line, filtering products, Order comments, Order notes</p><p>Purchase Order To Receive and To Return screens (no batch product support)</p><p>Stock Transfer</p><p>&nbsp;</p><p>&nbsp;</p><p>Below is the recording from my meeting with them where they took me through the existing screens. Assumption is that APIs are available and ready to use and we are just building the UI. They are doing some R&amp;D on mobile UI mockups but for now base the estimate on basic Material Design or iOS design language. The aim is to make these screens user friendly and mobile friendly.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Recording</strong></p><p><a target=\"_blank\" href=\"https://entrixcomau-my.sharepoint.com/:u:/g/personal/shamira_entrix_com_au/ETyPGtvI28pAreZwLbQYgz0B8_85NmKOzYWWwVzeK4VyCw?e=XOWgv6\">https://entrixcomau-my.sharepoint.com/:u:/g/personal/shamira_entrix_com_au/ETyPGtvI28pAreZwLbQYgz0B8_85NmKOzYWWwVzeK4VyCw?e=XOWgv6</a></p><p>&nbsp;</p><p><strong>Some UI mockups for Sales Order screen - see attached</strong></p><p>&nbsp;</p><p><strong>Dev Environment</strong></p><p><a target=\"_blank\" href=\"http://gcorpdev.westus2.cloudapp.azure.com/GcorpPRODWebAppVue/home\">http://gcorpdev.westus2.cloudapp.azure.com/GcorpPRODWebAppVue/home</a></p><p>U/N: dist</p><p>P/W: demouser</p>',50,1,4,NULL,NULL,'2021-03-05','2021-03-05 04:31:30','2021-03-12 02:58:53'),(67,'Start Google GIS, Pdftron,UI',NULL,23,3,1,NULL,NULL,'2021-03-09','2021-03-09 16:34:21','2021-03-12 02:58:25'),(68,'Tuti changes on 15th',NULL,1,8,1,NULL,'2021-03-15','2021-03-10','2021-03-10 03:19:36','2021-03-12 02:58:03'),(69,'Building department - Demo','<p>Dobin දත්ත ඇතුලත් කිරීමේ පද්ධතියේ දැනට හදුනා ගන්නා ලද ගැටළු</p><p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dobin දත්ත පද්ධතියේ Master Program 1 හි පවතින Approved date by client යන දත්ත ඇතුලත් කරනු ලබන යෙදුම Master program 2 සදහා ගෙන යා යුතුය.</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dobin දත්ත පද්ධතියේ Master Program 1 සදහා කොන්ත්&zwj;රාත් අංශය(Contract branch) මගින් නිකුත් කරනු ලබන ගිවිසුම් පත් ඇතුලත් කල හැකිවන පරිදි (Attachment ) එකක් සකස් කල යුතුය.</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; මෙම දත්ත පද්ධතිය මගින් PDF Format ලෙස දත්ත ඇතුලත්ව නිකුත්වනු ලබන සියළුම පත්&zwj;රකාවන්ගේ Appearance එක හදුනා ගැනීමේ සහ භාවිතයේ පහසුව සදහා වෙනස් විය යුතුය.</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dobin දත්ත පද්ධතියේ Consultancy Program Interface එකෙහි Output එකක් ලෙස දෙනු ලබන PDF Icon නය නිවැරදිව ක්&zwj;රියා නොකරන අතර &lsquo;error&rsquo; (දෝෂයක්) ලෙස පෙන්වයි.</p><p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fiance Interface එකෙහි පවතින Add Estimate No යෙදුම සදහා එම කොටසට අතුලත්වන පරිදි ගණනය කිරීමක් (Calculation) කරගැනීම සදහා Link එකක් ඇතුලත් කර ගත යුතුය.</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dobin දත්ත පද්ධතියේ Master Program 2 හිදි යොදනු ලබන TEC (Rs) යන මුදලේ අගය කොමා සහිතව ප්&zwj;රමාණාත්මකව හදුනාගැනීමට පහසුවන අයුරින් Fiance Interface එකෙහිදි පෙන්නුම් නොකරයි.</p><p>7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Search &nbsp;කිරිමේදි භාවිතා කරන්නාට පහසුවන අයුරින් එක අකුරක් සදහා හෝ වදනක් සදහා Search &nbsp;නොවීම.</p>',51,14,1,NULL,NULL,'2021-03-10','2021-03-10 07:21:25','2021-03-12 02:57:46'),(70,'RMS update','<p>As requested I have attached the screen recordings and the admin approvals have been left unattended for testing purposes at your end.<br />Please note that admin approvals are not in order &ndash; we need it in date order as well. (every time we click on admin approvals &ndash; the approvals randomly jumble)<br /><br />Also please give us a solution asap because the admin approvals need to be attended for partner relationship purposes.</p><p>&nbsp;</p><p><a href=\"https://drive.google.com/drive/folders/1uVQ2_4aifr0rrU_uBptxb3igI-kv33c_?usp=sharing\">https://drive.google.com/drive/folders/1uVQ2_4aifr0rrU_uBptxb3igI-kv33c_?usp=sharing</a></p>',45,15,1,NULL,NULL,